n"},{"attributes":{"bounds":[0,300],"end":300},"id":"1120","type":"Range1d"},{"attributes":{"text":"Observations and measurements of stars in Gaia EDR3"},"id":"1122","type":"Title"},{"attributes":{},"id":"1207","type":"AllLabels"},{"attributes":{"data_source":{"id":"1118"},"glyph":{"id":"1148"},"hover_glyph":null,"level":"image","muted_glyph":null,"nonselection_glyph":{"id":"1150"},"view":{"id":"1153"}},"id":"1152","type":"GlyphRenderer"},{"attributes":{"background_fill_color":"#fafafa","below":[{"id":"1180"}],"center":[{"id":"1183"},{"id":"1187"}],"height":500,"left":[{"id":"1184"}],"renderers":[{"id":"1193"}],"title":{"id":"1171"},"toolbar":{"id":"1188"},"width":500,"x_range":{"id":"1169"},"x_scale":{"id":"1176"},"y_range":{"id":"1174"},"y_scale":{"id":"1178"}},"id":"1170","subtype":"Figure","type":"Plot"},{"attributes":{"line_alpha":{"value":0.1},"line_color":{"field":"color"},"xs":{"field":"x"},"ys":{"field":"y"}},"id":"1192","type":"MultiLine"},{"attributes":{"fill_color":{"field":"color"},"line_color":{"field":"color"},"size":{"value":10},"x":{"field":"x"},"y":{"field":"y"}},"id":"1163","type":"Circle"},{"attributes":{"data":{"color":["red","blue","green"],"x":[50,40,270],"y":[40,15,35]},"js_property_callbacks":{"change:data":[{"id":"1195"}]},"selected":{"id":"1219"},"selection_policy":{"id":"1218"}},"id":"1161","type":"ColumnDataSource"},{"attributes":{"args":{"p1_source":{"id":"1161"},"p2_source":{"id":"1189"}},"code":"\n\n        \n        function lnBetaFunc(a, b) {\n            // Log Beta Function\n            // ln(Beta(x,y))\n            let foo = 0.0;\n\n            for (var i=0; i&lt;a-2; i++) {\n                foo += Math.log(a-1-i);\n            }\n            for (var i=0; i&lt;b-2; i++) {\n                foo += Math.log(b-1-i);\n            }\n            for (var i=0; i&lt;a+b-2; i++) {\n                foo -= Math.log(a+b-1-i);\n            }\n            return foo;\n        }\n        function betaFunc(x,y) {\n            // Beta Function\n            // Beta(x,y) = e^(ln(Beta(x,y))\n            return Math.exp(lnBetaFunc(x,y));\n        }\n        function lnBetaPDF(x, a, b) {\n            // Log of the Beta Probability Density Function\n            return ((a-1)*Math.log(x) + (b-1)*Math.log(1-x)) - lnBetaFunc(a,b)\n        }\n        function betaPDF(x, a, b) {\n            // Beta probability density function impementation\n            // using logarithms, no factorials involved.\n            // Overcomes the problem with large integers\n            return Math.exp(lnBetaPDF(x, a, b))\n        }\n        \n        var p1_data = p1_source.data;\n        var p2_data = p2_source.data;\n        \n        // Loop over dots\n        for (var i = 0; i &lt; 3; i++) {\n            let n = Math.floor(p1_data['x'][i]);\n            let k = Math.floor(p1_data['y'][i]);\n            let new_alpha = 1 + k;\n            let new_beta = 1 + n - k;\n            let x = p2_data['x'][i]\n            let y = p2_data['y'][i]\n            if (k &lt;= n) {\n                var lnB = lnBetaFunc(new_alpha, new_beta);\n                for (var j = 0; j &lt; x.length; j++) {\n                    y[j] = Math.exp( (new_alpha-1)*Math.log(x[j]) + (new_beta-1)*Math.log(1-x[j])-lnB);\n                }\n            }\n        }\n        p2_source.change.emit();\n    "},"id":"1195","type":"CustomJS"},{"attributes":{"data_source":{"id":"1156"},"glyph":{"id":"1157"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":{"id":"1158"},"view":{"id":"1160"}},"id":"1159","type":"GlyphRenderer"},{"attributes":{"line_alpha":0.1,"line_color":"white","line_dash":[6],"x":{"field":"x"},"y":{"field":"y"}},"id":"1158","type":"Line"},{"attributes":{"source":{"id":"1156"}},"id":"1160","type":"CDSView"},{"attributes":{},"id":"1215","type":"Selection"},{"attributes":{"overlay":{"id":"1141"}},"id":"1139","type":"BoxZoomTool"},{"attributes":{"callback":null,"renderers":[{"id":"1152"}],"tooltips":[["(n,k)","($x{0,0}, $y{0,0})"],["# of stars","@image{0,0}"]]},"id":"1154","type":"HoverTool"},{"attributes":{},"id":"1220","type":"UnionRenderers"},{"attributes":{"height":100,"text":"The left panel shows a 2D histogram of stars in Gaia EDR3 by their predicted number of observations and actual number of astrometric measurements. \nYou can hover to see the number of stars in each cell.\nEach circle with centre (n, k) corresponds to one of the lines in the right panel. If Gaia was to observe a star n times and obtain k measurements, then the line shows your posterior on the measurement probability, assuming that every observation was equally likely to result in a measurement.\nIf you enable the 'Point Draw Tool' on the toolbar then you can click-and-drag the three circles and see the posteriors update.\nNote that we have not corrected these posteriors for the selection effect due to stars only appearing in Gaia EDR3 if they have at least five astrometric measurements.","width":200},"id":"1196","type":"Paragraph"},{"attributes":{"active_multi":null,"tools":[{"id":"1138"},{"id":"1139"},{"id":"1140"},{"id":"1154"},{"id":"1167"}]},"id":"1142","type":"Toolbar"},{"attributes":{},"id":"1140","type":"ResetTool"},{"attributes":{},"id":"1214","type":"UnionRenderers"},{"attributes":{},"id":"1138","type":"PanTool"},{"attributes":{},"id":"1221","type":"Selection"},{"attributes":{},"id":"1178","type":"LinearScale"},{"attributes":{"source":{"id":"1118"}},"id":"1153","type":"CDSView"},{"attributes":{"start":0},"id":"1174","type":"DataRange1d"},{"attributes":{},"id":"1135","type":"BasicTicker"},{"attributes":{"axis":{"id":"1134"},"dimension":1,"ticker":null,"visible":false},"id":"1137","type":"Grid"},{"attributes":{"data":{"x":[0,300],"y":[0,300]},"selected":{"id":"1217"},"selection_policy":{"id":"1216"}},"id":"1156","type":"ColumnDataSource"},{"attributes":{"axis":{"id":"1180"},"ticker":null},"id":"1183","type":"Grid"},{"attributes":{"text":"Posterior on the measurement probability"},"id":"1171","type":"Title"},{"attributes":{},"id":"
